selector_to_html = {"a[href=\"lbm_data.html#lbm-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.3. </span>LBM Metadata<a class=\"headerlink\" href=\"#lbm-metadata\" title=\"Permalink to this heading\">#</a></h2><p>The primary distinction between Light-Beads Microscopy datasets and standard 2p datasets are how the data is organized on disk.</p><p>This information is stored in the <a class=\"reference external\" href=\"https://docs.scanimage.org/Appendix/ScanImage%2BBigTiff%2BSpecification.html#scanimage-bigtiff-specification\">ScanImage Metadata</a>.</p>", "a[href=\"mbo_servers.html#software\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h2><h3><span class=\"section-number\">2.3.1. </span>miniforge3<a class=\"headerlink\" href=\"#miniforge3\" title=\"Permalink to this heading\">#</a></h3><p>Each user account has its own <code class=\"docutils literal notranslate\"><span class=\"pre\">Miniforge3</span></code> installation at <code class=\"docutils literal notranslate\"><span class=\"pre\">C:/Users/miniforge3</span></code>.</p><p>This is your environment to install and reinstall as you please. <em>DO NOT</em> install any software in the base environment as that will cause conflicts between all installed environments and require a reinstallation of miniforge3.</p>", "a[href=\"mbo_servers.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Server Guide<a class=\"headerlink\" href=\"#server-guide\" title=\"Permalink to this heading\">#</a></h1><p>As a user of MBO servers you will be given a login and a password to on a Windows Server 2022 desktop to be used with windows remote desktop.\nThis login will give you access to all of the resources of that server, shared with a limited number of other users.</p>", "a[href=\"mbo_servers.html#filesystem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Filesystem<a class=\"headerlink\" href=\"#filesystem\" title=\"Permalink to this heading\">#</a></h2><p>!Note: Both workstation and compute file-systems are <em>NOT</em> backed up. Users should have a backup of all data on their own system.</p><p>The <code class=\"docutils literal notranslate\"><span class=\"pre\">D:</span></code> drive is <strong>read-only</strong> and contains</p>", "a[href=\"mbo_servers.html#first-steps\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>First steps<a class=\"headerlink\" href=\"#first-steps\" title=\"Permalink to this heading\">#</a></h2><p>The first thing you will likely want to do is setup a connection to the server with <a class=\"reference external\" href=\"https://learn.microsoft.com/en-us/windows/terminal/tutorials/ssh\"><code class=\"docutils literal notranslate\"><span class=\"pre\">ssh</span></code></a>.</p><p>Unlike a personal desktop, MBO servers will not be accessible from any computer on the Rockefeller network.\nThe only way to access the server is via Remote Desktop Protocol. There are a few common applications, depending on your operating system:</p>", "a[href=\"#guides\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guides<a class=\"headerlink\" href=\"#guides\" title=\"Permalink to this heading\">#</a></h1><p>Guides for users analyzing microscopy data.</p>", "a[href=\"lbm_data.html#frame-ordering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.2. </span>Frame Ordering<a class=\"headerlink\" href=\"#frame-ordering\" title=\"Permalink to this heading\">#</a></h2><p>ScanImage saves raw tiffs with each z-depth and timepoint interleaved [zT]:</p>", "a[href=\"lbm_data.html#array-terminology\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Array Terminology<a class=\"headerlink\" href=\"#array-terminology\" title=\"Permalink to this heading\">#</a></h2><p>Light-beads microscopy is a 2-photon imaging paradigm based on <a class=\"reference external\" href=\"https://docs.scanimage.org/index.html\">ScanImage</a> acquisition software.</p>", "a[href=\"lbm_data.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h1><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
